/** returns true if the sets have any elements in common */
public boolean intersects(FixedBitSet other) {
  int pos = Math.min(wordLength, other.wordLength);
  while (--pos>=0) {
    if ((bits[pos] & other.bits[pos]) != 0) return true;
  }
  return false;
}

